            <img class="bf" alt="" src="data:image/png;base64,">
            <div class="c x0 y0 w1 h1">
                <div class="t m0 x1 h2 y1 ff1 fs0 fc0 sc0 ls0 ws0">***This is system generated document, does not require any </div>
                <div class="t m0 x1 h2 y2 ff1 fs0 fc0 sc0 ls0 ws0">signature &amp; stamp***</div>
            </div>
