                <div class="t m0 x1 hc y13 ff1 fs3 fc0 sc0 ls0 ws0">"It is agreed that the goods declared herein are accepted in apparent good order and condition (except as noted)<span class="fc1 sc0"> </span></div>
                <div class="t m0 x1 hc y14 ff1 fs3 fc0 sc0 ls0 ws0">for carrier SUBJECT TO THE CONDITIONS OF CONTRACT ON THE REVERSE HEREOF. ALL GOODS MAY </div>
